import react from "react";
import Card from "../../../../UI/Card/Card";

const PokemonMoves = (props) => {
  const moveList = props.stats.moves.forEach((move) => {
    return (
      <li>
        <div>1</div>
        <div>{move.move.name}</div>
      </li>
    );
  });

  return (
    <div>
      <h1>Moves</h1>
      <ul>{moveList}</ul>
    </div>
  );
};

export default PokemonMoves;
